_join','<p>Pellentesque quis sagittis mi, ac tempus nulla. Cras ut enim ut neque hendrerit faucibus. Praesent fringilla dignissim augue quis faucibus. Curabitur dapibus nulla maximus elementum volutpat. Nam faucibus tristique hendrerit. Nulla facilisi. Vivamus nisl nibh, blandit malesuada egestas ut, congue at enim. Proin non semper velit. Vivamus sit amet aliquam velit, eget pretium lectus. Nullam aliquet dignissim mauris a semper. Fusce sollicitudin hendrerit convallis. Sed sed posuere justo. Proin eleifend nisl vel urna sagittis euismod. Pellentesque consequat elementum est, vehicula vestibulum magna. Pellentesque commodo ultrices iaculis.</p>\n														<p>Donec ut volutpat mi. Donec blandit, metus congue lobortis laoreet, tortor mauris varius urna, sed imperdiet arcu urna non elit. Suspendisse consequat dapibus sapien id sollicitudin. Nam id lacus nec mi malesuada luctus. Vestibulum aliquet sapien nec est dapibus, in lobortis nunc accumsan. Sed congue accumsan urna in maximus. Nunc lorem nulla, fringilla ac blandit quis, euismod posuere tortor. Donec ut congue tellus. Nunc tempus maximus arcu ac euismod. Maecenas tempus varius leo, egestas interdum lectus vestibulum at. Ut placerat consequat nisl in luctus. Nullam congue, quam quis malesuada tempus, eros nulla sagittis nulla, ut porttitor orci purus scelerisque erat. Mauris euismod est convallis scelerisque ultricies. Aenean eget velit tellus.</p>','2015-12-04 21:46:50',NULL,'2015-12-06 03:46:50','2015-12-06 03:46:50',NULL),(11,'term_and_condition','<h2>Perjanjian Penggunaan Layanan Situs</h2> \r\n\r\n<p><br></p><p>Perjanjian Penggunaan Layanan Situs www.balin.id (Perjanjian) antara Pengguna sebagai pengguna Situs www.balin.id (Pengguna) dan CV BALIN INDONESIA sebagai pengelola Situs www.balin.id (situs Balin.id), ini memuat syarat-syarat dan ketentuan penggunaan layanan situs Balin.id yang berlaku bagi Pengguna untuk dapat menggunakan situs Balin.id. CV BALIN INDONESIA selanjutnya dapat disebut juga dengan