but membayar untuk layanan tertentu yang mungkin disediakan oleh situs Balin.id.</li>\r\n<li>Dengan mengakses atau menggunakan situs Balin.id ini, Pengguna yang termasuk dalam kategori Pengguna sebagaimana disebutkan dalam poin 1.2. di atas secara sadar dan tanpa paksaan dari pihak manapun menyatakan diri setuju untuk menerima semua syarat dan ketentuan yang tercantum dalam Perjanjian ini. Sebagai Pengguna, Pengguna terikat dengan syarat dan ketentuan dalam Perjanjian yang berlaku dalam hal Pengguna mengakses atau menggunakan situs Balin.id ini. Jika Pengguna tidak menerima semua syarat dan ketentuan dalam Perjanjian ini, Pengguna diharuskan untuk langsung meninggalkan situs Balin.id.</li>\r\n<li>Kami dapat mengubah atau memperbarui Perjanjian ini setiap waktu dengan mencantumkan Perjanjian yang telah diubah atau diperbarui di dalam situs dan persyaratan dan ketentuan yang telah diubah dan diperbarui akan segera berlaku setelah persyaratan dan ketentuan yang telah diubah dan diperbarui dicantumkan oleh situs Balin.id, dan Pengguna diwajibkan untuk setiap saat membaca persyaratan dan ketentuan baru dan dianggap telah menyetujui perubahan atau pembaruan tersebut apabila setelah dicantumkan di dalam situs Balin.id dan Pengguna terus menggunakan situs Balin.id.</li>\r\n<li>Dalam situs Balin.id akan atau telah terdapat sambungan atau hyperlink (Pranala) yang terhubung situs milik pihak ketiga yang terdapat dalam Pranala di luar situs Balin.id, dan Kami dengan ini menyatakan tidak bertanggung jawab atas isi Pranala di luar situs Balin.id atau situs yang disediakan atau dipasang oleh pihak ketiga (Isi Pihak Ketiga), baik yang dimasukkan oleh pengguna yang tidak disebutkan namanya atau oleh penyedia isi yang memperoleh pembayaran, atau bukan dibuat oleh kami. Dengan ditampilkannya Isi Pihak Ketiga dalam situs Balin.id, tidak berarti bahwa Kami maupun pihak terafiliasi, pejabat, petugas atau pegawainya menjalin hubungan kerja sebagai agen penjualan dengan pihak ketiga terseb